    root.left.left.left = TreeNode(29)
    root.left.left.right = TreeNode(39)
    root.right.right = TreeNode(88)
    root.right.right.left = TreeNode(85)
    root.right.right.right = TreeNode(89)
    root.right.right.right.right = TreeNode(999)
    return root
